import React, { useEffect, useState } from "react";
import axios from "axios";
import Card from "../components/Card";
import Button from "../components/Button";
import {
  Users,
  Package,
  ShoppingCart,
  DollarSign,
  RefreshCcw,
  ExternalLink,
} from "lucide-react";

export default function Dashboard() {
  const [customerCount, setCustomerCount] = useState(0);
  const [productCount, setProductCount] = useState(0);
  const [orderCount, setOrderCount] = useState(0);
  const [revenue, setRevenue] = useState(0);
  const [lastUpdated, setLastUpdated] = useState("");

  const token = localStorage.getItem("token"); // ✅ get JWT token
  const axiosAuth = axios.create({
    baseURL: "http://localhost:5000/api",
    headers: { Authorization: `Bearer ${token}` },
  });

  const fetchAllData = async () => {
    try {
      const [customers, products, orders] = await Promise.all([
        axiosAuth.get("/ingest/customers"),
        axiosAuth.get("/ingest/products"),
        axiosAuth.get("/ingest/orders"),
      ]);

      setCustomerCount(customers.data.length);
      setProductCount(products.data.length);
      setOrderCount(orders.data.length);

      const totalRevenue = orders.data.reduce(
        (sum, order) => sum + parseFloat(order.total_price || 0),
        0
      );
      setRevenue(totalRevenue.toFixed(2));

      const now = new Date();
      setLastUpdated(now.toLocaleTimeString());
    } catch (err) {
      console.error("Error fetching dashboard data:", err);
    }
  };

  const handleIngest = async (type) => {
    try {
      const res = await axiosAuth.get(`/ingest/${type}`);
      alert(`✅ ${type} ingested: ${res.data.count || res.data.length}`);
      fetchAllData();
    } catch (err) {
      alert(`❌ Failed to ingest ${type}`);
      console.error(`Error ingesting ${type}:`, err);
    }
  };

  useEffect(() => {
    fetchAllData();
  }, []);

  return (
    <div className="container py-4">
      {/* Header */}
      <div className="d-flex justify-content-between align-items-center mb-4">
        <h1 className="h4 fw-bold">Shopify Analytics</h1>
        <div className="d-flex align-items-center gap-3">
          <span className="text-muted small">Last updated: {lastUpdated}</span>
          <Button
            className="btn btn-light d-flex align-items-center gap-2"
            onClick={fetchAllData}
          >
            <RefreshCcw size={16} /> Refresh
          </Button>
          <Button className="btn btn-success d-flex align-items-center gap-2">
            <ExternalLink size={16} /> Shopify Admin
          </Button>
        </div>
      </div>

      {/* Overview Section */}
      <h2 className="h5 fw-semibold mb-3">Overview</h2>
      <div className="row g-3 mb-4">
        <Card className="col-12 col-md-3 bg-success bg-opacity-10">
          <div>
            <p className="text-muted mb-1">Total Customers</p>
            <p className="h3 fw-bold">{customerCount}</p>
          </div>
        </Card>
        <Card className="col-12 col-md-3 bg-info bg-opacity-10">
          <div>
            <p className="text-muted mb-1">Products</p>
            <p className="h3 fw-bold">{productCount}</p> {/* ✅ fixed */}
          </div>
        </Card>
        <Card className="col-12 col-md-3 bg-success bg-opacity-25">
          <div>
            <p className="text-muted mb-1">Orders</p>
            <p className="h3 fw-bold">{orderCount}</p>
          </div>
        </Card>
        <Card className="col-12 col-md-3 bg-warning bg-opacity-25">
          <div>
            <p className="text-muted mb-1">Revenue</p>
            <p className="h3 fw-bold">₹{revenue}</p>
          </div>
        </Card>
      </div>

      {/* Data Ingestion */}
      <h2 className="h5 fw-semibold mb-3">Data Ingestion</h2>
      <div className="row g-3">
        <Button
          className="btn btn-light col-12 col-md-4 d-flex justify-content-center align-items-center gap-2"
          onClick={() => handleIngest("customers")}
        >
          <Users size={20} /> Ingest Customers
        </Button>
        <Button
          className="btn btn-light col-12 col-md-4 d-flex justify-content-center align-items-center gap-2"
          onClick={() => handleIngest("products")}
        >
          <Package size={20} /> Ingest Products
        </Button>
        <Button
          className="btn btn-light col-12 col-md-4 d-flex justify-content-center align-items-center gap-2"
          onClick={() => handleIngest("orders")}
        >
          <ShoppingCart size={20} /> Ingest Orders
        </Button>
      </div>
    </div>
  );
}
